import {Routes, Route, useNavigate, renderMatches} from 'react-router-dom';
import logo from './logo.svg';
import gcmateLogo from './img/GCMateIcon.png';
import './App.css';

function App() {
  

  
  return (
    <div 
      className="App"
      style={{
        backgroundImage: 'url('+gcmateLogo+')',
        backgroundSize: "cover",
        height: "100vh", 
        filter: "blur(4px)"
      }}>
      
    </div>
  );
}

function Background() {
  return (
    <div style={{
      backgroundImage: 'url('+gcmateLogo+')',
      backgroundSize: "cover",
      height: "100vh", 
      filter: "blur(4px)"
    }}>
    
  </div>
  );
}
export default App;
